interface Init {
    (list: string): string;
    <T>(list: ArrayLike<T>): T[];
}
declare const _default: Init;
/**
 * Returns all but the last element of the given list or string.
 *
 * @param {Array} arr
 * @return {*}
 * @example
 *
 *      init([1, 2, 3]);  //=> [1, 2]
 *      init([1, 2]);     //=> [1]
 *      init([1]);        //=> []
 *      init([]);         //=> []
 */
export default _default;
